import pdfMake from 'pdfmake/build/pdfmake'
import pdfFonts from 'pdfmake/build/vfs_fonts'
import * as moment from 'moment'
var JsBarcode = require('jsbarcode')

async function pdfMaker(usersEd) {

    console.log('usersEd', usersEd)

    pdfMake.vfs = pdfFonts.pdfMake.vfs
    pdfMake.fonts = {
        THSarabunNew: {
            normal: 'THSarabunNew.ttf',
            bold: 'THSarabunNew Bold.ttf',
            italics: 'THSarabunNew Italic.ttf',
            bolditalics: 'THSarabunNew BoldItalic.ttf'
        },
        Roboto: {
            normal: 'Roboto-Regular.ttf',
            bold: 'Roboto-Medium.ttf',
            italics: 'Roboto-Italic.ttf',
            bolditalics: 'Roboto-MediumItalic.ttf'
        }
    }

    let content = []
    let table_card, table_logo
    let text_logo = 'โรงเรียนอนุบาลเชียงคำ (วัดพระธาตุสบแวน)'
    let name_title

    for (let j = 0; j < usersEd.length; j++) {
        let name_title = { text: usersEd[j].name, fontSize: 16 }
        let col = [name_title]
        for (let index = 0; index < usersEd[j].data.length; index++) {
            //ใส่ตารางดาต้าตรงนี้
            if (usersEd[j].data[index].sex == "ชาย") {
                name_title = 'เด็กชาย'
            } else {
                name_title = 'เด็กหญิง'
            }

            table_card = {
                table: {
                    widths: [230, 230],
                    body: [
                        [{
                            border: [true, true, true, false],
                            table: {
                                body: [
                                    [{
                                        image: 'data:image/jpeg;base64,',
                                        width: 30,
                                        alignment: 'center',
                                        border: [false, false, false, false],
                                        margin: [8, 13, 0, 0]
                                    }, {
                                        text: 'โรงเรียนอนุบาลเชียงคำ (วัดพระธาตุสบแวน) \n บัตรสมาชิกสหกรณ์ร้านค้าโรงเรียน',
                                        margin: [8, 15, 0, 12],
                                        fontSize: 13,
                                        alignment: 'center',
                                        border: [false, false, false, false],
                                    }],
                                ]
                            },
                        }, { text: 'โปรดแสดงบัตรสมาชิกทุกครั้งเมื่อซื้อของจากสหกรณ์ร้านค้า', margin: [6, 5, 0, 0], border: [true, true, true, false], }],
                        [{
                            table: {
                                body: [
                                    [{
                                        text: name_title + usersEd[j].data[index].firstname + " " + usersEd[j].data[index].lastname,
                                        fontSize: 16,
                                        border: [false, false, false, false],
                                        alignment: 'left',
                                        margin: [8, 8, 0, 0],
                                    }],
                                    [{
                                        text: 'รหัสสมาชิก ' + usersEd[j].data[index].code,
                                        fontSize: 16,
                                        border: [false, false, false, false],
                                        alignment: 'left',
                                        margin: [8, 2, 0, 10],
                                    }],
                                ]
                            },
                            border: [true, false, true, true],
                        }, {
                            image: textToBase64Barcode(usersEd[j].data[index].barcode),
                            alignment: 'center',
                            width: 100,
                            border: [true, false, true, true],
                        }],
                    ],
                },
                unbreakable: true,
            }
            col.push(table_card)
        }
        let col2 = [col]
        content.push({
            columns: col2,
            rowGap: 10,
            pageBreak: "after"
        })
    }

    var doc = {
        content: content,
        defaultStyle: {
            font: 'THSarabunNew'
        },
        pageSize: 'A4',
        pageOrientation: 'portrait',
        pageMargins: [30, 20, 20, 10],
    }
    pdfMake.createPdf(doc).open()
}


function textToBase64Barcode(text) {
    var canvas = document.createElement("canvas");
    JsBarcode(canvas, text, { format: "EAN13", displayValue: true });
    return canvas.toDataURL("image/png");
}

export default {
    pdfMaker,
}